import React, {useState, useEffect} from "react";
import ListShip from "../ListStarship";

function ListStarship () {
  const [ships, setShips] = useState([]);

  useEffect(() => {
    async function List () {
      const response = await ListShip.get("search", {
      });

      setShips(response.results);
    }

  }, [])

  return (
    <>
      <div>{ships}</div>
    </>
  );
};

export default ListStarship;
